import styled from 'styled-components';


export const NavigationBar = styled.nav`
  width: 100%;
  height: 20%;
`;

export const HomeText = styled.div`
  color: white;
  margin-left: 8%;
  margin-top: 10%;
`;

export const Ul = styled.ul`
  width: 30%;
  height: 15%;
`;

export const Li = styled.li`
  color: white;
`;

 

    

export default NavigationBar;
